import React from 'react';

const IconDashboard = () => {
    return (
        <svg width="44" height="44" viewBox="0 0 44 44" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path fill-rule="evenodd" clip-rule="evenodd" d="M13 16.5C13 13.8748 13.0281 13 16.5 13C19.9719 13 20 13.8748 20 16.5C20 19.1252 20.0111 20 16.5 20C12.9889 20 13 19.1252 13 16.5Z" stroke="#1DC071" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path fill-rule="evenodd" clip-rule="evenodd" d="M24 16.5C24 13.8748 24.0281 13 27.5 13C30.9719 13 31 13.8748 31 16.5C31 19.1252 31.0111 20 27.5 20C23.9889 20 24 19.1252 24 16.5Z" stroke="#1DC071" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path fill-rule="evenodd" clip-rule="evenodd" d="M13 27.5C13 24.8748 13.0281 24 16.5 24C19.9719 24 20 24.8748 20 27.5C20 30.1252 20.0111 31 16.5 31C12.9889 31 13 30.1252 13 27.5Z" stroke="#1DC071" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        <path fill-rule="evenodd" clip-rule="evenodd" d="M24 27.5C24 24.8748 24.0281 24 27.5 24C30.9719 24 31 24.8748 31 27.5C31 30.1252 31.0111 31 27.5 31C23.9889 31 24 30.1252 24 27.5Z" stroke="#1DC071" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
        </svg>

    );
};

export default IconDashboard;
